import React from 'react'
import Grid from '@material-ui/core/Grid';


export default function Footer() {
    return (
        <>
        <Grid container style={{width:"100%",height:'300px',backgroundColor:"#323a43"}}>
            <Grid xs={12} md={4}>
                <p>Address 66 Broklyn Street, New York</p>
            </Grid>
        </Grid>
        </>
    )
}
